import React from 'react';
import { useNavigate } from 'react-router-dom';

const CoverPage = () => {
  const navigate = useNavigate();

  return (
    <div className="d-flex align-items-center justify-content-center vh-100 bg-light text-center">
      <div className="container">
        <h1 className="display-4 mb-3">Transcript Meeting App</h1>
        <p className="lead mb-4">Upload, Transcribe, and Share Your Meetings with Ease</p>
        <div className="d-flex justify-content-center gap-3">
          <button
            onClick={() => navigate('/signup')}
            className="btn btn-primary btn-lg"
          >
            Sign Up
          </button>
          <button
            onClick={() => navigate('/login')}
            className="btn btn-secondary btn-lg"
          >
            Log In
          </button>
        </div>
      </div>
    </div>
  );
};

export default CoverPage;
